INSERT INTO `lottery_play_class_group` VALUES (1808, 117, 1229, '1410', '14101', '1410110', '混合', '投注方案~大\n开奖号码：\n09，09，09   和值27 (下注属性为开奖号码和值属性)，即中奖', '大小：根据开奖三个号码的和值、和值0-13为小，14-27为大。\n单双：根据开奖三个号码的和值、是双数则为双、是单数则为单。\n大单/大双：根据开奖三个号码的和值、大于或等于15的单数则为大单、大于或等于14的双数则为大双。\n小单/小双：根据开奖三个号码的和值、小于或等于13的单数则为小单、小于或等于12的双数则为小双。\n极大/极小：根据开奖三个号码的和值、和值22-27为极大、0-5为极小。', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1809, 117, 1230, '1411', '14111', '1411110', '色波', '投注方案~红波\n开奖号码：\n01，01，01，和值03(下注属性为开奖号码和值属性)，即中奖', '红波/蓝波/绿波：三个数值之和“03,06,09,12,15,18,21,24为红波、01,04,07,10,16,19,22,25为绿波、02,05,08,11,17,20,23,26为蓝波”。\n', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1810, 117, 1231, '1412', '14121', '1412110', '豹子', '投注方案~豹子\n开奖号码：\n01，01，01(下注属性为开奖号码属性)，即中奖', '豹子：开出的三个号码相同则为豹子。', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1811, 117, 1232, '1413', '14131', '1413110', '特码包三', '投注方案~01，02，03\n开奖号码：\n03，04，05(下注号码包含开奖号码和值)，即中奖', '选取三个特码,三个特码中有任一号码和开奖结果一致即中奖。', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1812, 117, 1233, '1414', '14141', '1414110', '特码', '投注方案~27\n开奖号码：\n09，09，09(下注号码和值于开奖号码和值相同)，即中奖', '从数字0-27中选取一个数字，中奖以对应赔率奖励。', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
