INSERT INTO `lottery_play_class_group` VALUES (1813, 118, 1234, '1620', '16201', '1620110', '百位', '投注方案~01，03，05\n开奖号码：\n01，03，05 即中直选复式', '从千、百、十、个四位，每个位置至少选择一个号码进行投注，所选号码和开奖号码在指定位置上的号码相同，且顺序一致，即为中奖。', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1814, 118, 1235, '1620', '16201', '1620111', '十位', '投注方案~01，03，05\n开奖号码：\n01，03，05 即中直选复式', '从千、百、十、个四位，每个位置至少选择一个号码进行投注，所选号码和开奖号码在指定位置上的号码相同，且顺序一致，即为中奖。', 1, 2, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1815, 118, 1236, '1620', '16201', '1620112', '个位', '投注方案~01，03，05\n开奖号码：\n01，03，05 即中直选复式', '从千、百、十、个四位，每个位置至少选择一个号码进行投注，所选号码和开奖号码在指定位置上的号码相同，且顺序一致，即为中奖。', 1, 3, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1816, 118, 1237, '1621', '16211', '1621110', '二重号', '投注方案~二重好-1 单号-2\n开奖号码：\n112、121、211即中奖', '当期开奖号码的三位数中任意两位数字相同，且投注号码与当期开奖号码相同（顺序不限），即中奖', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1817, 118, 1238, '1621', '16211', '1621111', '单号', '投注方案~二重好-1 单号-2\n开奖号码：\n112、121、211即中奖', '当期开奖号码的三位数中任意两位数字相同，且投注号码与当期开奖号码相同（顺序不限），即中奖', 1, 2, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1818, 118, 1239, '1621', '16212', '1621210', '组选6', '投注方案~456\n开奖号码：\n456、546、654、645即中奖', '当期开奖号码的三位数各不相同，且投注号码与当期开奖号码相同（顺序不限），即中奖', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1819, 118, 1240, '1622', '16221', '1622110', '百位', '投注方案~十位 1\n开奖号码：\n4、1、5 投注位置和号码与开奖结果一致即中奖', '是指对百位、十位或个位中某一特定位置上的号码进行投注，投注号码与当期开奖号码中对应位置的号码相同，即中奖', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1820, 118, 1241, '1622', '16221', '1622111', '十位', '投注方案~十位 1\n开奖号码：\n4、1、5 投注位置和号码与开奖结果一致即中奖', '是指对百位、十位或个位中某一特定位置上的号码进行投注，投注号码与当期开奖号码中对应位置的号码相同，即中奖', 1, 2, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1821, 118, 1242, '1622', '16221', '1622112', '个位', '投注方案~十位 1\n开奖号码：\n4、1、5 投注位置和号码与开奖结果一致即中奖', '是指对百位、十位或个位中某一特定位置上的号码进行投注，投注号码与当期开奖号码中对应位置的号码相同，即中奖', 1, 3, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1822, 118, 1243, '1623', '16231', '1623110', '猜1D', '投注方案~ 1\n开奖号码：\n4、1、5 开奖结果中包含投注号码即中奖', '是指对百位、十位或个位中任意一个位置上的号码进行投注，投注号码与当期开奖号码中任意一个位置的号码相同，即中奖', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1823, 118, 1244, '1624', '16241', '1624110', '百位', '投注方案~ 百位 2 十位 1\n开奖号码：\n2、1、5 投注两个号码的位置和号码与开奖结果相同即中奖', '对百位和十位、十位和个位或百位和个位号码，以唯一的排列方式进行投注，投注号码与当期开奖号码中对应两个位置的号码按位相同，即中奖', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1824, 118, 1245, '1624', '16241', '1624111', '十位', '投注方案~ 百位 2 十位 1\n开奖号码：\n2、1、5 投注两个号码的位置和号码与开奖结果相同即中奖', '对百位和十位、十位和个位或百位和个位号码，以唯一的排列方式进行投注，投注号码与当期开奖号码中对应两个位置的号码按位相同，即中奖', 1, 2, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1825, 118, 1246, '1624', '16241', '1624112', '个位', '投注方案~ 百位 2 十位 1\n开奖号码：\n2、1、5 投注两个号码的位置和号码与开奖结果相同即中奖', '对百位和十位、十位和个位或百位和个位号码，以唯一的排列方式进行投注，投注号码与当期开奖号码中对应两个位置的号码按位相同，即中奖', 1, 3, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1826, 118, 1247, '1625', '16251', '1625110', '两同号', '投注方案~ 1\n开奖号码：\n1、1、5 开奖结果中包含投注两个号码即中奖', '选择任意的号码进行投注，投注号码为两个相同的号码，且当期开奖号码中包含投注的两个相同号码，即中奖', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1827, 118, 1248, '1625', '16252', '1625210', '两不同号', '投注方案~ 1、2\n开奖号码：\n1、3、2 开奖结果中不包含投注两个号码即中奖', '选择任意的号码号码进行投注，投注号码为两个不同的号码，且当期开奖号码中包含投注的两个不同号码（顺序不限），即中奖', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1828, 118, 1249, '1626', '16261', '1626110', '和数', '投注方案~ 和值2\n开奖号码：\n0、2、0 开奖结果和值与投注号码相同即中奖', '对三个号码相加之和进行投注，投注号码与当期开奖号码的三个号码相加之和相同，即中奖', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1829, 118, 1250, '1627', '16271', '1627110', '和数', '投注方案~ 和值大\n开奖号码：\n8、8、9 开奖结果和值属性与投注属性相同即中奖', '和值大小：三个号码相加之和在19（含）至27（含）之间时为大，\n在0（含）至8（含）之间时为小\n和值单双：:三个号码相加之和单双性质进行投注。其中，1、3、5、7、9为单，0、2、4、6、8为双', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1830, 118, 1251, '1627', '16271', '1627111', '百位', '投注方案~ 百位大\n开奖号码：\n9、1、1 开奖结果百位属性与投注属性相同即中奖', '百位大小：百位号码在5（含）至9（含）之间时为大，\n在0（含）至4（含）之间时为小\n百位单双：:百位号码单双性质进行投注。其中，1、3、5、7、9为单，0、2、4、6、8为双', 1, 2, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1831, 118, 1252, '1627', '16271', '1627112', '十位', '投注方案~ 十位大\n开奖号码：\n1、9、1 开奖结果十位属性与投注属性相同即中奖', '十位大小：百位号码在5（含）至9（含）之间时为大，\n在0（含）至4（含）之间时为小\n百位单双：:百位号码单双性质进行投注。其中，1、3、5、7、9为单，0、2、4、6、8为双', 1, 3, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1832, 118, 1253, '1627', '16271', '1627113', '个位', '投注方案~ 个位大\n开奖号码：\n1、1、9 开奖结果个位属性与投注属性相同即中奖', '个位大小：百位号码在5（含）至9（含）之间时为大，\n在0（含）至4（含）之间时为小\n百位单双：:百位号码单双性质进行投注。其中，1、3、5、7、9为单，0、2、4、6、8为双', 1, 4, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1833, 118, 1254, '1628', '16281', '1628110', '猜三同', '投注方案~ 猜三同\n开奖号码：\n8、8、8 开奖结果属性与投注属性相同即中奖', '猜三同:对全部三个相同的号码进行投注', 1, 1, '2020-12-08 15:00:00', '2020-12-08 15:00:00');
